import React from 'react'

function Phones() {
    return (
        <div>
            <div className="border h-48 flex">
                <div className="border h-full w-3/12"></div>
                <div className="border h-full w-4/12"></div>
                <div className="border h-full w-3/12"></div>
            </div>

        </div>
    )
}

export default Phones
